import React from "react";

const Modal=props=>{
    return (
        <div className="modal">
            <div className="modal-content">
                <div className="modal-header">
                    <h4 className="modal-title"> Modal Başlık</h4>
                </div>
                <div className="modal-body">
                    <p>modal content</p>
                </div>
                <div className="modal-fotter">
                    <p>modal footer </p>
                </div>
            </div>

        </div>
    )
}
export default Modal;
